data.text:
@Negradramaa O jovem vivia e trabalhava na África de Sul, voltou porque supostamente matou alguém por lá. 
E quando chegou se envolveu com essas moças que acabaram mortas e a mãe acobertou o assassinato com rebarbadora, por isso foi considerada cúmplice. 
É mesmo uma gang, até o pai. 😢😢😢
